    def getProductValue(self, product, currPrice):
        self.regressions[product] = self.regressions[product][1:] + [currPrice]
        model = np.poly1d(np.polyfit(np.arange(1, len(self.regressions[product])+1), np.array(self.regressions[product]), 1))
        return model(len(self.regressions[product]))

    def do_order(self, bot_orders, operator, max_vol, acceptable_price, trade_made, product, order_lst):
        reverse = False
        if trade_made == "SELL":
            reverse = True
        tradeHappened = False
        orders_sorted = sorted(bot_orders.keys(), reverse = reverse)
        for prices in orders_sorted:
            if operator(prices, acceptable_price):
                volume = abs(bot_orders[prices])
                vol_to_trade = min(volume, max_vol)
                if vol_to_trade <= 0:
                    break
                max_vol -= vol_to_trade
                # In case the lowest ask is lower than our fair value,
                # This presents an opportunity for us to buy cheaply
                # The code below therefore sends a BUY order at the price level of the ask,
                # with the same quantity
                # We expect this order to trade with the sell order
                print(trade_made, str(vol_to_trade) + "x", prices)
                if trade_made == "BUY":
                    order_lst.append(Order(product, prices, vol_to_trade))
                    tradeHappened = True
                elif trade_made == "SELL":
                    order_lst.append(Order(product, prices, -vol_to_trade))
                    tradeHappened = True
            else: 
                break
            if max_vol <= 0:
                break
        
        if tradeHappened or not tradeHappened:
            quantity = (self.limits[product]//int(self.limits[product]**0.5)) * 2
            if trade_made == "BUY":
                less = (max_vol+quantity-1)//quantity
                for i in range(int(acceptable_price) - 2, int(acceptable_price) - 2 - less, -1):
                    vol = quantity if max_vol >= quantity else max_vol
                    print("BUY", str(-vol) + "x", i)
                    order_lst.append(Order(product, i, vol))
                    max_vol -= vol
            elif trade_made == "SELL":
                less = (max_vol+quantity-1)//quantity
                for i in range(int(acceptable_price) + 2, int(acceptable_price) + 2 + less):
                    vol = quantity if max_vol >= quantity else max_vol
                    print("SELL", str(vol) + "x", i)
                    order_lst.append(Order(product, i, -vol))
                    max_vol -= vol

    def run(self, state: TradingState) -> Dict[str, List[Order]]:

        if not self.initalizedStart:
            self.initData()

        result = {}
        for product in state.order_depths.keys():
            pos = state.position.get(product, 0)
            max_buy = 20 - pos
            max_sell = abs(-20 - pos)
            order_depth: OrderDepth = state.order_depths[product]

            print(order_depth.buy_orders)
            print(order_depth.sell_orders)
            maxBid, minAsk = max(order_depth.buy_orders.keys()), min(order_depth.sell_orders.keys())
            midpoint = (maxBid + minAsk)/2
            print('midpoint', midpoint)
            productVal = self.getProductValue(product, midpoint)

            orders: list[Order] = []

            self.do_order(bot_orders = order_depth.sell_orders, operator = operator.lt, max_vol = max_buy, acceptable_price= productVal, trade_made="BUY", product=product, order_lst = orders)

            self.do_order(bot_orders = order_depth.buy_orders, operator = operator.gt, max_vol = max_sell, acceptable_price= productVal, trade_made="SELL", product=product, order_lst = orders)

            result[product] = orders

            print(f'{product} Bid Quantity: {len(order_depth.buy_orders)}')
            print(f'{product} Ask Quantity: {len(order_depth.sell_orders)}')
            print(f'{product} Mid Price: {midpoint}')
        

        return result
    
